import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Button,
  Row,
  Container,
  Col,
  FormGroup,
  Input,
  Form,
  Card,
  CardHeader
} from "reactstrap";
import { Typography } from "@material-ui/core";
import "../App.css";
import Header from "../header/header";
import Footer from "../footer";
import EventMap from "../mapping/eventhome";

class MyTicket extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Container>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1
            style={{ textAlign: "left", color: "#FF5555", fontWeight: "700" }}
          >
            My Ticket
          </h1>
          <br></br>
          <br></br>
          <div className="ticketBox">
            <br></br>
            <br></br>
            <br></br>
            <Container>
              <div className="ticket">
                <Row className="ticket-header justify-content-between">
                  <h1>Anon</h1>
                  <p>Face Value Rp300.000</p>
                </Row>
                <div className="ticket-body">
                  <h1>Anon Concert</h1>
                  <h2>Tanggal entah kapan</h2>
                  <p>Ini alamatnya</p>
                </div>
              </div>
            </Container>

            <br></br>
            <br></br>
          </div>
        </Container>
        <Footer />
      </div>
    );
  }
}

export default MyTicket;
